import "./Expenses.css";
import ExpenseItem from "./components/ExpenseItem";

function Expenses(props) {
  return props.expenses.forEach((expense) => {
    <ExpenseItem
      title={expense.title}
      amount={expense.amount}
      date={expense.date}
    />;
  });
}

export default Expenses;
